import React from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Carousel, ListGroup, Nav, Navbar, Container, NavDropdown} from 'react-bootstrap';
import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import "./css/inicio.css"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee } from '@fortawesome/free-solid-svg-icons'

function inicio(){
    return(
        <div className="Inicio">
        {/* Empezando el NavBar */}
        <Navbar className="color-auto" variant="dark">
            <Container>
                <Navbar.Brand href="#home"><img src={require('./ImgInicio/logo.png')} width='100%' height='50px'/>{' '}</Navbar.Brand>
            <Nav className="me-auto">
                <Nav.Link><Link to="/">Inicio</Link></Nav.Link>
                <Nav.Link>Comics</Nav.Link>
                <Nav.Link>Información</Nav.Link>
            </Nav>
            <Nav>
                <Nav.Link><i class="fa-solid fa-heart fa-xl"></i></Nav.Link>
                <Nav.Link>Iniciar sesión</Nav.Link>
                <Nav.Link>Registrarse</Nav.Link>
            </Nav>
            </Container>
        </Navbar>
        {/* Finalizando el NavBar */}    
        </div>
    );
}

export default inicio;
